import { View, ImageBackground, Text } from 'react-native';
import { LinearGradient } from 'expo-linear-gradient';
export default function HomeScreen() {
    return (
        <ImageBackground source={require('../assets/images/developer.jpg')} style={{ width: '100%', height: '100%' }}>
            <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>0

                <LinearGradient colors={["transparent", "blue"]} />

                <Text style={{ fontSize: 20 }}>Hello</Text>
            </View>
        </ImageBackground>
    );
}
